#include <bits/stdc++.h>

const char * pool = "";
int cur = 0;
struct _ {
	int x, y, l;
} ;
std::vector<_> ansl[61][61];
int get() {
	char t = pool[cur++];
	if (t >= 'a') return t - 'a';
	if (t >= 'A') return t - 'A' + 26;
	return t - '0' + 52;
}
int main() {
#define FILENAME "hard"
#ifdef ONLINE_JUDGE
	freopen(FILENAME ".in", "r", stdin);
	freopen(FILENAME ".out", "w", stdout);
#endif
	std::ios_base::sync_with_stdio(false), std::cin.tie(0);
	int N = 60;
	for (int i = 1; i <= N; ++i)
		for (int j = i; j <= N; ++j) {
			int c = get();
			while (c --> 0) {
				int x = get();
				int y = get();
				int z = get();
				ansl[i][j].push_back((_) {x, y, z});
			}
		}
	int T; std::cin >> T;
	while (T --> 0) {
		int n, m;
		std::cin >> n >> m;
		if (n > m) {
			std::cout << ansl[m][n].size() << '\n';
			for (auto t : ansl[m][n])
				std::cout << t.y << ' ' << t.x << ' ' << t.l << '\n';
		} else {
			std::cout << ansl[n][m].size() << '\n';
			for (auto t : ansl[n][m])
				std::cout << t.x << ' ' << t.y << ' ' << t.l << '\n';
		}
	}
	return 0;
}
